import React from 'react'

const DisplayAnser = ({question}) => {
  return (
    <div>
      {
        question.answer.map((ans) => (
          <div className='display-ans' key={ans._id}>
            <p>{ans.answerBody}</p>
            <div className="question-action-user">
              <div>
                <button >share</button>
              </div>
            </div>

          </div>
        ))
      }
    </div>
  )
}

export default DisplayAnser
